export class WomenComponent {
  // code for carousel
  images = [
    { src: 'assets/women/carousel1.png', alt: 'Image 1' },
    { src: 'assets/women/carousel2.png', alt: 'Image 2' },
    { src: 'assets/women/carousel3.png', alt: 'Image 3' },
